import React from 'react';
import { FaceScannerPage as FaceScannerPageComponent } from '../components/FaceScanner';

/**
 * Face Scanner Page with 3D face scanning, measurement, and eyewear styling
 */
const FaceScannerPage = ({ showNotification }) => {
  return (
    <FaceScannerPageComponent showNotification={showNotification} />
  );
};

export default FaceScannerPage;
